  class Login extends Component {

    constructor(props){
      super(props);

      this.state = {
        err: ''
      };

      this.login = this.login.bind(this);
      this.signup = this.signup.bind(this);
      this.logout = this.logout.bind(this);
      this.google = this.google.bind(this);
    }

    render(){
      return(
        <div>
        </div>
      );
    }
  }


  export default Login;
